INSERT INTO `achievement_reward` VALUES (1956, 0, 0, 0, 0, 0, 43824, 16128, 'Higher Learning', 'Congratulations on completing your studies on The Schools of Arcane Magic. In recognition of your dedication, I\'m enclosing this special volume completing the series.$B$BI believe you\'ll find this tome particularly entertaining. But I\'ll leave that for your discovery.$B$BSincerely,$B$BRhonin', '');
INSERT INTO `achievement_reward` VALUES (2051, 140, 140, 0, 0, 0, 0, 0, '', '', '');
INSERT INTO `achievement_reward` VALUES (2054, 121, 121, 0, 0, 0, 0, 0, '', '', '');
INSERT INTO `achievement_reward` VALUES (2096, 0, 0, 0, 0, 0, 44430, 29478, 'The Coin Master', 'Greetings and congratulations on collecting the full set of Dalaran coins! As a reward for all your hard work I have enclosed a freshly minted Titanium Seal of Dalaran. This is a special coin that we only grant to the most ardent of collectors.$B$BI hope you enjoy this special reward. You\'ve earned it!$B$BSincerely,$BJepetto Joybuzz', '');
INSERT INTO `achievement_reward` VALUES (2136, 0, 0, 0, 0, 0, 44160, 26917, 'Glory of the Hero', 'Champion,$B$BWord has traveled to Wyrmrest Temple of the great heroic deeds you have accomplished since arriving in Northrend.$B$BYour bravery should not go unrecognized. Please accept this gift on behalf of the Aspects. Together we shall rid Azeroth of evil, once and for eternity.$B$BAlexstrasza the Life-Binder', '');
INSERT INTO `achievement_reward` VALUES (2143, 0, 0, 0, 0, 0, 44178, 32216, 'Leading the Cavalry', 'I couldn\'t help but to notice how good you are with the livestock. With all the activity around here, business has been better than ever for me. I don\'t suppose you\'d mind looking after this Albino Drake for me? I simply don\'t have enough spare minutes in the day to care for all of these animals. Yours, Mei', '');
INSERT INTO `achievement_reward` VALUES (2144, 0, 0, 0, 0, 0, 44177, 26917, 'Time and Time again', 'With the drums of war pounding in the distance, it is easy for the denizens of Azeroth to forget all that life has to offer.$B$BYou, on the other hand, have maintained the dignity of the good races of Azeroth with your ability to remember what we fight for. To not celebrate our victories is another form of defeat. Remeber that well, Reveler.$B$BMay others be inspired by your good cheer,$B$BAlexstrasza the Life-Binder', '');
