INSERT INTO `achievement_reward` VALUES (7385, 0, 0, 0, 0, 0, 87528, 73649, 'Honorary Brewmaster Keg', '$N,$B\r\nThanks for all your hard work crafting some of the finest brews we\'ve ever had!$B\r\nAs a token of our appreciation, the other Brewmasters and I have decided to give you this Honorary Brewmaster Keg.$B\r\nEnjoy!$B\r\n-Mama Stormstout', '');
