INSERT INTO `achievement_reward` VALUES (7499, 0, 0, 0, 0, 0, 92738, 28951, 'Safari hat', 'It\'s hard to believe, but you really defeated these pet tamers! $B\r\nI followed your progress and I want to say that they are impressive! Victory after victory! And I thought that this hat might come in handy on your way to the title of Zen Master of Pandaria. $B\r\nKeep it up! $B\r\nBreanni', '');
INSERT INTO `achievement_reward` VALUES (7500, 0, 0, 0, 0, 0, 85578, 28951, 'Going to Need More Leashes', NULL, '');
