INSERT INTO `achievement_reward` VALUES (7612, 321, 321, 0, 0, 0, 0, 0, NULL, NULL, '');
INSERT INTO `achievement_reward` VALUES (7860, 0, 0, 0, 0, 0, 91802, 32216, 'We\'re Going to Need More Saddles', 'I\'ve heard your stables are nearly as extensive as mine, now. Impressive! Perhaps we can help one another.. I\'ve one too many dragonhawks, and hoped you could give this one a home. Naturally its been trained as a mount and not a hunting pet, and you\'ll find it as loyal and tireless as any other steed I raise. $B Yours again,Mei', '');
INSERT INTO `achievement_reward` VALUES (7862, 0, 0, 0, 0, 0, 91802, 32216, 'We\'re Going to Need More Saddles', 'I\'ve heard your stables are nearly as extensive as mine, now. Impressive! Perhaps we can help one another.. I\'ve one too many dragonhawks, and hoped you could give this one a home. Naturally its been trained as a mount and not a hunting pet, and you\'ll find it as loyal and tireless as any other steed I raise. $B Yours again,Mei', '');
INSERT INTO `achievement_reward` VALUES (7908, 0, 0, 0, 0, 0, 92744, 66741, 'Aki the Chosen', 'I thought you would never defeat me. $B $B I heard rumors that you were accepted into the ranks of pet tamers, but I could not imagine that everything would go so far. Now you are truly a master! Accept this gift as a token of respect for both me and all those pet tamers you defeated. $B $B Congratulations! $B $ BA Ki Favorite', '');
INSERT INTO `achievement_reward` VALUES (8023, 338, 338, 0, 0, 0, 0, 0, NULL, NULL, '');
INSERT INTO `achievement_reward` VALUES (8049, 0, 0, 0, 0, 129671, 94197, 61962, 'The Zandalari Prophecy', 'Greetings $n,\r\n\r\nYou have learned much of the Prophet Zul and the Zandalari. Perhaps you should join us at the Seat of Knowledge and share with us this wisdom you have learned.\r\n\r\nIncluded should be a map to our location. I look forward to our next meeting.\r\n\r\nSincerely,\r\nLorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (8050, 0, 0, 0, 0, 129671, 94198, 61962, 'Rumbles of Thunder', 'Greetings $n,\r\n\r\nIt would seem you learned much of the dreaded Thunder King. Perhaps you should join us at the Seat of Knowledge and share with us this wisdom you have learned.\r\n\r\nIncluded should be a map to our location. I look forward to our next meeting.\r\n\r\nSincerely,\r\nLorewalker Cho', '');
INSERT INTO `achievement_reward` VALUES (8051, 0, 0, 0, 0, 129671, 94199, 61962, 'Gods and Monsters', 'Greetings $n,\r\n\r\nIs it true you have discovered the origins of the mogu? You must come and join us at the Seat of Knowledge and share with us this wisdom you have learned.\r\n\r\nIncluded should be a map to our location. I look forward to our next meeting.\r\n\r\nSincerely,\r\nLorewalker Cho', '');
