INSERT INTO `achievement_reward` VALUES (12416, 0, 0, 0, 0, 0, 156836, 103976, 'Through storms, rain and thunderstorms', '$n!\r\n\r\nOnly thanks to your heroism do letters continue their journey across Azeroth and beyond.\r\n\r\nHowever, I must confess: I did not tell you the whole truth.\r\n\r\nThe events that first brought you here were rigged - I knew that only you could save the post office from an untimely end.\r\n\r\nBut I can’t count only on you. Mail should function without your help, so I’ll ask you to lure someone else into these rooms.\r\n\r\nTake the attached message and send it to someone you consider worthy to continue this good work. I also send you a special whistle that you can call to help Katie. if needed.\r\n\r\n- Postman', '');
INSERT INTO `achievement_reward` VALUES (12431, 0, 0, 0, 0, 0, 156721, 103976, 'Express delivery', '$n\r\n\r\nYou, without a doubt, know about my wonderful couriers, postal minds. They have repeatedly provided me with all possible assistance, and in such catastrophic situations as recently, they simply cannot do without them.\r\n\r\nOne of the kids was imbued with special feelings for you - apparently, impressed by your incredible ability to sort mountains of disordered correspondence.\r\n\r\nWith heartache, I part with my assistant, but I have no choice. You will find the postal mental directly in the envelope - do not worry, they are familiar with such conditions. They even like that. You can use it as a bedside table if you wish.\r\n\r\n- Postman', '');
